# async-await

> es5的回调让我们痛苦,es6的promise带我们脱离苦海,es7的async-await带我们走向光明。

本文解决的问题：
- async-await含义和使用
- promise会被代替吗
- 我实际遇到过的问题

<!-- more -->

## async-await含义和使用

async-await其实是es6的promise和generator的语法糖。

- async:

用于函数前,表示该函数是一个异步函数;

函数返回一个promise,所以函数内部接受resolve(),可以链式调用then;

若没有resolve,可以接受return代表resolve(async才有的特性)。
``` bash
function async demo() {
    console.log(Math.random())
    return '123'  // 相当于resolve('123')
}
demo().then(value => { console.log(value) })
控制台输出：
    1.23131
    123
```

- await:

这是async wait的缩写,表示异步等待操作,所以await只能用于async的函数中;

await后可以跟任何的表达式,但是主要还是跟promise对象表示异步等待操作;若跟了一个普通的表达式,那么就直接执行下去;若跟一个promise对象,那么就要等待promise对象状态resolve完成,并且接受返回的resolve值,才会继续执行下去。
``` bash
function async demo() {
    const aw = await Math.random()
    return aw
}
function async demo1() {
    const aw = await new Promise((resolve) => {
        console.log('promise inside')
        resolve('resolve')
    })
    return aw
}
demo().then(value => { console.log('demo', value) })
demo1().then(value => { console.log('demo1', value) })
控制台输出：
    demo, 1.2321
    promise inside
    demo1, resolve
```

## async-await会代替promise吗
这个新上手的人可能会觉得async-await简直是神器,然后到处都在使用,然后写出一些bug
``` bash
假设这里demo开头的函数都返回peomise
function async demo1() {
    await demo1()
    await demo2()
    await demo3()
    return '123'
}
这个函数在demo1、2、3执行条件关联的情况(即后面的执行需要前面的结果)场景下,是没问题的。
但是若是在demo1、2、3z执行条件没有关联下,即并发执行,这样肯定是不合适的。
function async demo1() {
    const dm1 = demo1()
    const dm2 = demo2()
    const dm3 = demo3()
    Promise.all([dm1, dm2, dm3])
    return '123'
}
所以async-await有它的优点，但也不是能完全的代替promise
```

## 我实际遇到过的问题
await在for循环中的问题,所以再次说一句,await必须执行在async函数的上下文环境中,直接上代码了
``` bash
function async demo1() {
    Array.prototype.map.call(array, (arr) => {
        await arr.promiseFun()
        return '错误'
    })
}
```

# exports + module.exports 和 export default + export 和 require

对于前端和node这些导入/导出区别，有时会经常搞混，现在我整理了一下，希望有所帮助

本文解决的问题：
- 各自的使用范围
- exports + module.exports的不同
- export default + export的不同
- 为什么require可以在node和es6都可以使用，并且有的地方会使用require('xx').default调用

<!-- more -->

## 适用范围(需要配置相应的babel)
es6和node都适用：require + import
node适用：exports + module.exports
es6适用：export + export default

所以这里着重说明两者的导出


## node的exports + module.exports
node模块在文件初始化的时候，会创建一个module对象和exports对象,大致关系如下：
``` bash
module.exports = exports = {}

//utils.js
let a = 100;
console.log(module.exports); //能打印出结果为：{}
console.log(exports); //能打印出结果为：{}
```
* 都指向同一块内存空间

``` bash
//utils
exports.a = 200;
console.log(module.exports) //能打印出结果为：{a : 200}
exports = '指向其他内存区'; //这里把exports的指向指走,exports =相当于给exports对象重新赋值

//test.js
var a = require('/utils');
console.log(a) // 打印为 {a : 200} exports导入后是一个对象，module可以导出函数
```
* 从上面可以看出，require导入的内容其实是module.exports指向的内存空间，并不是exports
* 简而言之，就是exports只是module.exports的引用，辅助后者向内存添加东西的（很苦逼）


* 当同时具备module.exports和exports时，以前者为主（有以下的原因）
* 当改变module.exports时，exports的指向不会改变，exports不再指向module.exports了
* 所以经常有以下的写法，恢复exports的活性
``` bash
exports = module.exports = { ... }
```

推荐统一使用module.exports，以免出错


## es6的export + export default
* export与export default均可用于导出常量、函数、文件、模块等
* export default 不能直接导出变量表达式
* 在一个文件中export、import可以有多个，但是export default只能有一个
* export导出，引入时需要加上{}标识；export default导出不用
``` bash
'use strict'
//test.js
//导出变量
export const a = '100';
 //导出方法
export const dogSay = function(){
    console.log('wang wang');
}
 //导出方法第二种
function catSay(){
   console.log('miao miao');
}
export { catSay };
const m = 100;
export default m;
//export defult const m = 100;// 这里不能写这种格式-不能直接导出表达式。


//index.js
'use strict'
import { dogSay, catSay } from './test'; //导入了 export 方法
import m from './testEs6Export';  //导入了 export default
import * as testModule from './test'; //as 集合成对象导入
  dogSay();
  catSay();
  console.log(m);
  testModule.dogSay();
  console.log(testModule.m); // undefined , 因为  as 导出是把零散的export聚集在一起作为一个对象，而export default是导出为 default属性。
  console.log(testModule.default); // 100
```
* 从上面可以看出export和export default是关联不大的两个导出方式

## 为什么require和import可以在es6和commonjs规范中使用
babel能够在打包前提前将es6的导出语法转化成commonjs规范，具体转化如下
``` bash
    es6导出模块：
    export default = 'abc'
    exporrt const a = 'a'
    export {b: 4}

    babel转化后：
    exports.default = 'abc'
    exports.a = 'a'
    exports.b = 4
    exports.__esModule = true // 标记这个是由es6转化为commonjs输出
    等价于
    exports.module = {
        default: 'abc',
        a: 'a',
        b: 4,
        __esModule: true,
    }
```

babel也能够在打包前提前将es6的导入语法转化成commonjs规范，具体转化如下
``` bash
    es6导入模块：
    import a from './a.js' // 导入export default模块
    import { a } from './a.js' // 导入export下的模块
    import * as a from './a.js' // 导入所有没款

    babel转化后：
    var a = require('./a.js').default // 引入export default模块
    var a = require('./a.js').a
    var a = require('./a.js')
```
这样require('xx')导入的为对象{default: 'abc', a: 'a', b: 4,...}
这里也就解释了为什么有的地方会require('xx').default调用

在commonjs规范中的require:
``` bash
    babel转化过程：
    function _interopRequireWildcard(obj) {
        if (obj && obj.__esModule) {
            return obj;
        }
        else {
            var newObj = {}; // (A)
            if (obj != null) {
                for (var key in obj) {
                    if (Object.prototype.hasOwnProperty.call(obj, key))
                        newObj[key] = obj[key];
                }
            }
            newObj.default = obj;
            return newObj;
        }
    }
    如果是es6模块，直接返回obj,若是commonjs模块，需要添加一个default,并把整个对象赋值个default
    所以es6中import a from './a.js'导入commonjs模块，即导入的是module.exports的值
```
所以import和require在es6和commonjs规范中可以互用

